><strong>Pulsadores</strong></h2>\"},\"subContentId\":\"09199157-2899-42ef-941f-b25a5e37f989\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Sin título Text\",\"authors\":[],\"changes\":[]}},\"backgroundOpacity\":100,\"multiple\":false},{\"x\":89.00045641259699,\"y\":50.712510776408536,\"width\":12.323145237430387,\"height\":3.2878822455499774,\"dropZones\":[\"0\",\"1\",\"2\",\"3\",\"4\",\"5\",\"6\"],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h2><strong>Protoboard</strong></h2>\"},\"subContentId\":\"f65e27a6-a19f-43e0-9a78-cae4b1a2defb\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Sin título Text\",\"authors\":[],\"changes\":[]}},\"backgroundOpacity\":100,\"multiple\":false}],\"dropZones\":[{\"x\":6.846188954815154,\"y\":16.228003448450732,\"width\":31.492469192149706,\"height\":8.215426745778185,\"correctElements\":[\"0\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 💡 ¡Luz verde, agente! Has identificado los LEDs correctamente. Son pequeñas luces que se encienden cuando la electricidad fluye. ¡Elemento clave en tus misiones electrónicas! 🔋✨\",\"feedbackOnIncorrect\":\"❌ Incorrecto: 🚫 Fallo en la identificación, agente. Esa no es la ubicación de los LEDs. Recuerda: son luces pequeñitas con dos patitas, una más larga que la otra. ¡Corrige y vuelve al escaneo! 🔎🔴\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Leds</div>\"},{\"x\":9.128251939753538,\"y\":30.427506465845124,\"width\":27.384755819260615,\"height\":6.846188954815154,\"correctElements\":[\"4\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 🌀 ¡Excelente, agente! Has localizado las resistencias. Son componentes que controlan el paso de electricidad para que nada se sobrecargue. ¡Una pieza fundamental en cualquier circuito! ⚡🛡️\",\"feedbackOnIncorrect\":\"❌ Incorrecto: 🚫 Cuidado, agente. Esa no es una resistencia. Recuerda: son cilindros pequeños con rayas de colores. Ayudan a que la electricidad no dañe los componentes. ¡Reintenta la conexión visual! 🎯👁️\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Resistencias</div>\"},{\"x\":50.20538566864446,\"y\":20.285004310563416,\"width\":12.323140118667276,\"height\":10.953902327704245,\"correctElements\":[\"1\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 🔊 ¡Sonido activado, agente! Has identificado correctamente el buzzer. Es el componente que emite sonidos o alertas. ¡Clave para comunicarte con tu robot! 📣🛠️\",\"feedbackOnIncorrect\":\"❌ Incorrecto: 🚫 Fallo de identificación, agente. Ese no es el buzzer. Recuerda: es un componente negro, redondo y puede tener un símbolo de &quot;+&quot; si es activo. ¡Afina tus sensores y reintenta! 🎧🔎\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Buzzer</div>\"},{\"x\":57.051574623459615,\"y\":54.76951163852122,\"width\":50.661798265632136,\"height\":30.123231401186676,\"correctElements\":[\"2\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 🧠 ¡Cerebro del robot detectado, agente! Has identificado la placa Arduino Uno. Es la mente maestra que controla todos los componentes. ¡Sin ella, no hay misión que avance! 🤖💡\",\"feedbackOnIncorrect\":\"❌ Incorrecto: 🚫 Error de cálculo, agente. Esa no es la placa Arduino Uno. Recuerda: es una tarjeta azul con muchos pines, un chip grande en el centro y el logo de Arduino. ¡Revisa tu mapa y vuelve a intentar! 🧭🔍\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Arduino Uno</div>\"},{\"x\":7.987220447284345,\"y\":42.59850905218317,\"width\":35.6001825650388,\"height\":12.32143358572712,\"correctElements\":[\"3\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 🔗 ¡Conexión establecida, agente! Has identificado los cables jumper. Son los caminos que llevan electricidad de un punto a otro en el circuito. ¡Sin ellos, no hay misión posible! 🚀🔌\",\"feedbackOnIncorrect\":\"❌ Incorrecto: ⚠️ Error de enlace, agente. Esos no son los cables jumper. Recuerda: son delgados, coloridos y tienen puntas metálicas en ambos extremos. ¡Busca mejor y vuelve a intentarlo! 🧠🕵️‍♂️\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Jumpers</div>\"},{\"x\":9.128251939753538,\"y\":75.05451594908463,\"width\":27.384755819260615,\"height\":4.10771170145624,\"correctElements\":[\"5\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 🖲️ ¡Acción precisa, agente! Has identificado el pulsador. Cuando lo presionas, permite que la electricidad fluya. ¡Es como un interruptor secreto en tu misión! 🔘⚡\",\"feedbackOnIncorrect\":\"❌ Incorrecto: 🚫 Ups, agente. Esa no es la ubicación del pulsador. Recuerda: es un pequeño botón con 2 o 4 patitas. Solo deja pasar la electricidad cuando lo presionas. ¡Escanea de nuevo! 🔍🕹️\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Pulsadores</div>\"},{\"x\":5.705157375292167,\"y\":6.085505007464245,\"width\":97.21588315837518,\"height\":5.476951163852123,\"correctElements\":[\"6\"],\"showLabel\":false,\"backgroundOpacity\":50,\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"✅ Correcto: 🎯 ¡Bien hecho, agente! Has ubicado la Protoboard correctamente. Es la zona de pruebas donde conectamos los circuitos sin usar soldadura. ¡Sigue así, estás en línea con la misión! ⚡🛠️\",\"feedbackOnIncorrect\":\"❌ Incorrecto: 🚫 Alerta, agente. Esa no es la Protoboard. Recuerda: es una placa blanca llena de agujeros donde se conectan los componentes para hacer pruebas sin soldar. ¡Reintenta y afina tu escáner! 🔍🤖\"},\"single\":false,\"autoAlign\":true,\"type\":{\"library\":\"H5P.DragQuestionDropzone 0.1\"},\"label\":\"<div>Protoboard</div>\"}]}},\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"enableRetry\":false,\"enableCheckButton\":true,\"singlePoint\":false,\"applyPenalties\":true,\"enableScoreExplanation\":true,\"dropZoneHighlighting\":\"always\",\"autoAlignSpacing\":2,\"enableFullScreen\":true,\"showScorePoints\":true,\"showTitle\":false},\"grabbablePrefix\":\"Elemento a colocar {num} de {total}.\",\"grabbableSuffix\":\"Colocado en zona de colocación {num}.\",\"dropzonePrefix\":\"Zona de colocación {num} de {total}.\",\"noDropzone\":\"No es zona de colocación.\",\"tipLabel\":\"Mostrar pista.\",\"tipAvailable\":\"Pista disponible\",\"correctAnswer\":\"Respuesta correcta\",\"wrongAnswer\":\"Respuesta incorrecta\",\"feedbackHeader\":\"Retroalimentación\",\"scoreBarLabel\":\"Has obtenido :num de un total de :total puntos\",\"scoreExplanationButtonLabel\":\"Mostrar explicación de la puntuación\",\"a11yCheck\":\"Comprobar las respuestas. Las respuestas serán marcadas como correcta, incorrecta o sin contestar.\",\"a11yRetry\":\"Vuelve a intentar la tarea. Borra todas tus respuestas y empieza de nuevo.\",\"localize\":{\"fullscreen\":\"Pantalla completa\",\"exitFullscreen\":\"Salir de pantalla completa\"}}","library":"H5P.DragQuestion 1.14","contentUrl":".","metadata":{"license":"U","title":"🎯 ¡Misión Visual: Identifica los Componentes del Robot!","defaultLanguage":"en"},"scripts":["undefined/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","undefined/libraries/jQuery.ui-1.10/h5p-jquery-ui.js?version=1.10.22","undefined/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","undefined/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","undefined/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?v
